import {
  SUMMARY_DATA,
  SUMMARY_DATA_BUSINESS,
  SUMMARY_DATA_SHOP,
  SUMMARY_DATA_MERCH,
  SUMMARY_DATA_ADGROUP,
  CUMULATIVE_FILTERS,
  LOADER,
  SHOW_VALIDATION
} from "./promoTypes";

const initialState = {
  summaryDataFromReducer: [],
  summaryDataFromReducerBusiness: [],
  summaryDataFromReducerShop: [],
  summaryDataFromReducerMerch: [],
  summaryDataFromReducerAdgroup: [],
  summaryCumulativeFilters: [],
  loading: null
};

export default function(state = initialState, action) {
  switch (action.type) {
    case SUMMARY_DATA:
      return {
        ...state,
        summaryDataFromReducer: action.payload
      };
    case SUMMARY_DATA_BUSINESS:
      return {
        ...state,
        summaryDataFromReducerBusiness: action.payload
      };
    case SUMMARY_DATA_SHOP:
      return {
        ...state,
        summaryDataFromReducerShop: action.payload
      };
    case SUMMARY_DATA_MERCH:
      return {
        ...state,
        summaryDataFromReducerMerch: action.payload
      };
    case SUMMARY_DATA_ADGROUP:
      return {
        ...state,
        summaryDataFromReducerAdgroup: action.payload
      };
    case SHOW_VALIDATION:
      return {
        ...state,
        loading: action.payload
      };

    case CUMULATIVE_FILTERS:
      return {
        ...state,
        summaryCumulativeFilters: action.payload
      };
    case LOADER:
      return {
        ...state,
        loader: action.payload
      };

    default:
      return state;
  }
}
